// CartComponent.js

import React from 'react';

function CartComponent({ cart }) {
  return (
    <div>
      <h2>Cart</h2>
      <ul>
        {cart.map((book, index) => (
          <li key={index}>{book.bookTitle}{
            book.id
          }</li>
        ))}
      </ul>
    </div>
  );
}

export default CartComponent;
